using System;\nusing System.Diagnostics;\n\nclass Program {\n    static void Main() {\n        const int iterations = 1000000;\n        Debug.WriteLine($"Running {iterations} iterations...");\n\n        // Measure Parse\n        Stopwatch swParse = new Stopwatch();\n        swParse.Start();\n        for (int i = 0; i < iterations; i++) {\n            try {\n                _ = int.Parse("12345");\n            } catch (FormatException) {}\n        }\n        swParse.Stop();\n\n        // Measure TryParse\n        Stopwatch swTryParse = new Stopwatch();\n        swTryParse.Start();\n        for (int i = 0; i < iterations; i++) {\n            _ = int.TryParse("12345", out _);\n        }\n        swTryParse.Stop();\n\n        Console.WriteLine($"Parse: {swParse.ElapsedMilliseconds} ms");\n        Console.WriteLine($"TryParse: {swTryParse.ElapsedMilliseconds} ms");\n\n    }\n}